import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./catSwiper.scss";
import '../../../node_modules/swiper/swiper.scss';
import { EffectCards, Pagination } from "swiper";
import "swiper/css/pagination";


function CatSwiper(props) {
    return (
        <div>
            <Swiper
                pagination={{
                    type: "progressbar"
                }}
                navigation={true}
                effect={"cards"}
                grabCursor={true}
                modules={[EffectCards, Pagination]}
                className="mySwiper"
            >

                {props.array.map((obj, index) => (
                    <SwiperSlide key={index}>
                        <div className="cat-swiper-name">{obj.name}</div>
                        <div className="cat-swiper-img">{obj.img}</div>
                        <div className="cat-swiper-url">{obj.url}</div>
                    </SwiperSlide>
                ))}
            </Swiper>
        </div>
    );
}

export default CatSwiper;
